import React, { Component } from 'react';
import Pastel from '../images/gallery.png';

export default class LatestCollection extends Component {
  constructor(props) {
    super(props);
    this.state = {
      recentItems: [
        { image: Pastel, title: 'Pastel', price: 450 },
        { image: Pastel, title: 'Pastel', price: 450 },
        { image: Pastel, title: 'Pastel', price: 450 }
      ]
    };
  }

  render() {
    return (
      <div>
        <div className='latestHeader'>
          <p>Latest Collection: </p>
        </div>
        <div className='latestContent'>
          {this.state.recentItems.map(item => {
            return (
              <div className='latestContent_image'>
                <img src={Pastel} className='latestContent_image-img' />
                <p className='latestContent_title'></p>
              </div>
            );
          })}
        </div>
      </div>
    );
  }
}
